  "translationLines": [
    {
      "lineNumber": 59271,
      "originalJapaneseLine": "「……おい！　配置にはついてるのだろうな！」",
      "translatedEnglishLine": "\"...Hey! You're in position, right?\""
    },
    {
      "lineNumber": 59272,
      "originalJapaneseLine": "「えっ、あっ、はい！」",
      "translatedEnglishLine": "\"Eh, ah, yes!\""
    },
    {
      "lineNumber": 59273,
      "originalJapaneseLine": "「気を抜くのではないぞ！　きびきび動け！」",
      "translatedEnglishLine": "\"Don't let your guard down! Move swiftly!\""
    },
    {
      "lineNumber": 59274,
      "originalJapaneseLine": "「は、ははっ！」",
      "translatedEnglishLine": "\"Y-Yes, haha!\""
    },
    {
      "lineNumber": 59275,
      "originalJapaneseLine": "（ホンマ、相手によって態度変わりよるなぁ……）",
      "translatedEnglishLine": "(Really, he changes his attitude depending on who he's dealing with...)"
    },
    {
      "lineNumber": 59276,
      "originalJapaneseLine": "「さぁ出撃だ！」",
      "translatedEnglishLine": "\"Alright, let's move out!\""
    },
    {
      "lineNumber": 59277,
      "originalJapaneseLine": "「ふあぁぁぁぁ……うむ、朝か……」",
      "translatedEnglishLine": "\"Fuaaaa... Hmm, morning, huh...\""
    },
    {
      "lineNumber": 59278,
      "originalJapaneseLine": "その頃。コーヒーの匂いが鼻をくすぐって、",
      "translatedEnglishLine": "At that time. The smell of coffee tickled his nose,"
    },
    {
      "lineNumber": 59279,
      "originalJapaneseLine": "ランスはようやく目を覚ましたところだった。",
      "translatedEnglishLine": "Rance had just finally awakened."
    },
    {
      "lineNumber": 59280,
      "originalJapaneseLine": "「あっ、おはようございます、ランス様……",
      "translatedEnglishLine": "\"Ah, good morning, Lord Rance..."
    },
    {
      "lineNumber": 59281,
      "originalJapaneseLine": "　ずいぶんお休みでしたね」",
      "translatedEnglishLine": "You've been resting quite a bit.\""
    },
    {
      "lineNumber": 59282,
      "originalJapaneseLine": "「ふふん、そうだな。",
      "translatedEnglishLine": "\"Hmph, that's right."
    },
    {
      "lineNumber": 59283,
      "originalJapaneseLine": "　ゆうべはちょっと、お楽しみ過ぎたわ」",
      "translatedEnglishLine": "I got a little too much enjoyment last night.\""
    },
    {
      "lineNumber": 59284,
      "originalJapaneseLine": "シィルが淹れたコーヒーを啜りながら、",
      "translatedEnglishLine": "Sipping the coffee prepared by Shīru,"
    },
    {
      "lineNumber": 59285,
      "originalJapaneseLine": "ニヤリとランスが笑う。",
      "translatedEnglishLine": "Rance grinned slyly."
    },
    {
      "lineNumber": 59286,
      "originalJapaneseLine": "「う…………あ、う……で、でも、それ……」",
      "translatedEnglishLine": "\"Ugh... Ah, uh... but, that...\""
    },
    {
      "lineNumber": 59287,
      "originalJapaneseLine": "お楽しみ、という言葉に釣られて見ると、",
      "translatedEnglishLine": "Lured by the word 'enjoyment,' when she looked,"
    },
    {
      "lineNumber": 59288,
      "originalJapaneseLine": "ランスの兵器は今日も天を突いている。",
      "translatedEnglishLine": "Rance's weapon was, as always, pointing to the sky today."
    },
    {
      "lineNumber": 59289,
      "originalJapaneseLine": "「ん？　おお、今日も絶好調だな。がはははは！",
      "translatedEnglishLine": "\"Hmm? Oh, today's in perfect condition too. Gahahahaha!"
    },
    {
      "lineNumber": 59290,
      "originalJapaneseLine": "　よしこい、シィル！」",
      "translatedEnglishLine": "Bring it on, Shīru!\""
    },
    {
      "lineNumber": 59291,
      "originalJapaneseLine": "「えっ、え、でも、皆さんお待ちですよ。",
      "translatedEnglishLine": "\"Eh, but everyone is waiting, you know."
    },
    {
      "lineNumber": 59292,
      "originalJapaneseLine": "　もう、戦争が始まって……きゃっ！」",
      "translatedEnglishLine": "The war's already started... kyah!\""
    },
    {
      "lineNumber": 59293,
      "originalJapaneseLine": "「がはははは、このエロ奴隷が！",
      "translatedEnglishLine": "\"Gahahahaha, you horny slave!"
    },
    {
      "lineNumber": 59294,
      "originalJapaneseLine": "　ならばさっさとイかせるように努力しろ！」",
      "translatedEnglishLine": "Then hurry up and make me cum!\""
    },
    {
      "lineNumber": 59295,
      "originalJapaneseLine": "「あ、ああぁぁっ！　ひんひん……」",
      "translatedEnglishLine": "\"Ah, aaaah! Hinhin...\""
    },
    {
      "lineNumber": 59296,
      "originalJapaneseLine": "自由都市連合軍　司令部――――",
      "translatedEnglishLine": "Free City Allied Forces Headquarters――――"
    },
    {
      "lineNumber": 59297,
      "originalJapaneseLine": "「前衛、射程距離に入りました！",
      "translatedEnglishLine": "\"Vanguard has entered firing range!"
    },
    {
      "lineNumber": 59298,
      "originalJapaneseLine": "　発砲許可、よろしいですか！」",
      "translatedEnglishLine": "Permission to fire, is it granted?\""
    },
    {
      "lineNumber": 59299,
      "originalJapaneseLine": "「ギリギリまで引きつけろ！",
      "translatedEnglishLine": "\"Hold them until the last moment!"
    },
    {
      "lineNumber": 59300,
      "originalJapaneseLine": "　カスタム砲兵隊、弓兵隊、魔法隊による斉射の後、",
      "translatedEnglishLine": "After a volley from the custom artillery, archers, and mage squads,"
    },
    {
      "lineNumber": 59301,
      "originalJapaneseLine": "　間を置かずに突撃する！」",
      "translatedEnglishLine": "Charge immediately without pause!\""
    },
    {
      "lineNumber": 59302,
      "originalJapaneseLine": "「てばさき隊に帰り木配っといてや！",
      "translatedEnglishLine": "\"Tell the Tebasaki squad to prepare to return!"
    },
    {
      "lineNumber": 59303,
      "originalJapaneseLine": "　軍師はん曰く、今日はこき使われるらしいで！」",
      "translatedEnglishLine": "The strategist says we'll be worked hard today!\""
    },
    {
      "lineNumber": 59304,
      "originalJapaneseLine": "「例の部隊の準備もいいかな。",
      "translatedEnglishLine": "\"Is the special unit ready as well?"
    },
    {
      "lineNumber": 59305,
      "originalJapaneseLine": "　いつでもピッチに出られるようにしといてね」",
      "translatedEnglishLine": "Make sure they're ready to go onto the field at any time.\""
    },
    {
      "lineNumber": 59306,
      "originalJapaneseLine": "「おう。なんだ騒がしいな」",
      "translatedEnglishLine": "\"Yeah. What's all the commotion?\""
    },
    {
      "lineNumber": 59307,
      "originalJapaneseLine": "「ランス！　もう始まっとるで」",
      "translatedEnglishLine": "\"Rance! It's already started.\""
    },
    {
      "lineNumber": 59308,
      "originalJapaneseLine": "「どんな具合だ？」",
      "translatedEnglishLine": "\"How's it looking?\""
    },
    {
      "lineNumber": 59309,
      "originalJapaneseLine": "「両軍が接触したトコや。",
      "translatedEnglishLine": "\"The two armies have just made contact."
    },
    {
      "lineNumber": 59310,
      "originalJapaneseLine": "　まだ魔人とか大将軍とか、大物の姿は無いな」",
      "translatedEnglishLine": "No appearances from demons or generals or major figures yet.\""
    },
    {
      "lineNumber": 59311,
      "originalJapaneseLine": "「そーかそーか、よし。",
      "translatedEnglishLine": "\"Is that so, is that so. Alright."
    },
    {
      "lineNumber": 59312,
      "originalJapaneseLine": "　そこら辺が出てくるまで見物のつもりだったが、",
      "translatedEnglishLine": "I intended to just watch until those guys showed up,"
    },
    {
      "lineNumber": 59313,
      "originalJapaneseLine": "　ちょいと出るか。戦いたい気分だ」",
      "translatedEnglishLine": "But maybe I'll go out a bit. I'm in the mood to fight.\""
    },
    {
      "lineNumber": 59314,
      "originalJapaneseLine": "「え、ホンマ？　ええと、ちょっと待ってな……」",
      "translatedEnglishLine": "\"Eh, really? Umm, wait a moment...\""
    },
    {
      "lineNumber": 59315,
      "originalJapaneseLine": "「総統さん、こっちのルートで行ってくれます？」",
      "translatedEnglishLine": "\"Chief Commander, could you take this route?\""
    },
    {
      "lineNumber": 59316,
      "originalJapaneseLine": "「む？」",
      "translatedEnglishLine": "\"Hmm?\""
    },
    {
      "lineNumber": 59317,
      "originalJapaneseLine": "篠田源五郎が、地図の上に指で線を引いた。",
      "translatedEnglishLine": "Gen Gorō Shinoda drew a line on the map with his finger."
    },
    {
      "lineNumber": 59318,
      "originalJapaneseLine": "「すごく強いんですよね。",
      "translatedEnglishLine": "\"They're really strong, right?"
    },
    {
      "lineNumber": 59319,
      "originalJapaneseLine": "　じゃあここをこう進んで……」",
      "translatedEnglishLine": "Then let's advance this way here...\""
    },
    {
      "lineNumber": 59320,
      "originalJapaneseLine": "「めんどくさい。",
      "translatedEnglishLine": "\"What a hassle."
    }
  ]
}

